import { motion } from "framer-motion"
import estyle from "./DiagonalLine.module.scss"

function DiagonalLine({props}) {

    console.log('props.delay is: ' + props.delay)

    const blah = props.delay;

    const startLine = {
        ready: { opacity:0, scale:1 },
        start: { opacity:1, scale:1,
            transition: {
                scale: {
                    delay: blah,
                    duration: .5
                },
                opacity: {
                    delay: blah,
                    duration: .4
                }
            }
        }
    }

    return (
        <div>
            <motion.svg className={estyle.diagonalline} width="10" height="10" viewBox="0 0 10 10" fill="none" xmlns="http://www.w3.org/2000/svg"
                variants={startLine}
                initial="ready"
                animate="start"
            >
            <path d="M11.3656 0.38544L0.758972 10.9921L1.11254 11.3456L11.7192 0.739003L11.3656 0.38544Z" fill={props.color}/>
            </motion.svg>
        </div>
    )
}
export default DiagonalLine;
